import React, { useState } from 'react';

import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
// import { MaterialCommunityIcons } from '@expo/vector-icons';
// import { Button, Input } from 'react-native-elements';
import Icon from 'react-native-vector-icons/FontAwesome';

import { View, Button, Text, StyleSheet, Image, TextInput, TouchableOpacity } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';





const Stack = createStackNavigator();
const Header = () => (

    <View style={styles.header}>
        <View style={styles.containerinfromacoes} >
            <Text style={styles.textoInforma}>INFORMAÇÕES</Text>
        </View>



    </View>

);


export default function informacoes() {
    // const avancar = () => {
    //     alert('oi')
    // }

    // const voltar = () => {
    //     alert('calma gisele')
    // }


    return (
        <><Header />




            <Stack.Navigator style={styles.noob}>

                <Stack.Group style={styles.teste}>

                    <Stack.Screen name='Nome' component={Nome('Idade')} options={{ headerShown: false }} />
                    <Stack.Screen name='Idade' component={Idade('Alergias')} options={{ headerShown: false }} />
                    <Stack.Screen name='Alergias' component={Alergias('Contatos')} options={{ headerShown: false }} />
                    <Stack.Screen name='Contatos' component={Contatos('Endereco')} options={{ headerShown: false }} />
                    <Stack.Screen name='Endereco' component={Endereco('')} options={{ headerShown: false }} />

                </Stack.Group>

            </Stack.Navigator></>
        // <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', display: 'flex' }}>
        //     <View style={styles.informacoes}>
        //         <View>
        //             <Text style={styles.informatexto}>CADASTRAR INFORMAÇOES</Text>
        //         </View>

        //         <View style={styles.caixaIforma}>
        //             <Text style={styles.textoInforma}>Suas  Informações</Text>
        //             <View>
        //                 <Input
        //                     placeholder='Informações...'
        //                     keyboardType='email-address'

        //                     onChangeText={value => setEmail(value)}
        //                     returnKeyType='done'
        //                 />

        //             </View>

        //         </View>

        //     </View>
        //     <View style={styles.botaoDireito}>

        //         

        //     </View>
        //     <View style={styles.botaoEsquerdo}>
        //         <Button
        //             icon={
        //                 <Icon
        //                     name="arrow-left"
        //                     size={15}
        //                     color="white"

        //                 />
        //             }

        //             onPress={voltar}
        //         />

        //     </View>
        // </View>
    );
}

function Nome(a) {
    return function ({ navigation }) {

        return (
            <View style={styles.body}>
                <View style={styles.teste}>
                    <TextInput
                        style={styles.input}
                        placeholder="Nome"
                    // onChangeText={(text) => setNome(text)}
                    // value={nome}
                    />
                </View>
                <TouchableOpacity style={styles.botao} onPress={() => navigation.navigate(a)}>

                    <Text style={styles.bto_Direita}>

                        <Icon
                            name="arrow-right"
                            size={35}
                            color="white"

                        />

                    </Text>

                    <Text>
                         <Icon
                        name="arrow-left"
                        size={35}
                        color="white"

                    />
                    </Text>

                </TouchableOpacity>
            </View>
        );
    }
}

function Idade(a) {
    return function ({ navigation }) {
        return (

            <View style={styles.body}>
                <View style={styles.teste}>
                    <TextInput
                        style={styles.input}
                        placeholder="Idade"
                    // onChangeText={(text) => setNome(text)}
                    // value={nome}
                    />
                </View>
                <TouchableOpacity style={styles.botao} onPress={() => navigation.navigate(a)}>

                    <Text style={styles.bto_Direita}>
                        <Icon
                            name="arrow-right"
                            size={35}
                            color="white"

                        />
                    </Text>
                    <Text>
                         <Icon
                        name="arrow-left"
                        size={35}
                        color="white"

                    />
                    </Text>


                </TouchableOpacity>
            </View>
        );
    }
}

function Alergias(a) {
    return function ({ navigation }) {
        return (

            <View style={styles.body}>
                <View style={styles.teste}>
                    <TextInput
                        style={styles.input}
                        placeholder="Alergias"
                    // onChangeText={(text) => setNome(text)}
                    // value={nome}
                    />
                </View>
                <TouchableOpacity style={styles.botao} onPress={() => navigation.navigate(a)}>

                    <Text style={styles.bto_Direita}>
                        <Icon
                            name="arrow-right"
                            size={35}
                            color="white"

                        />
                    </Text>
                    <Text style={styles.bto_esquerda}>
                         <Icon
                        name="arrow-left"
                        size={35}
                        color="white"

                    />
                    </Text>


                </TouchableOpacity>
            </View>
        );
    }
}


function Contatos(a) {
    return function ({ navigation }) {
        return (
            <View style={styles.body}>
                <View style={styles.teste}>
                    <TextInput
                        style={styles.input}
                        placeholder="N°-telefone"

                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Nome-contato"

                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Telefone-contato"

                    />
                </View>
                <TouchableOpacity style={styles.botao} onPress={() => navigation.navigate(a)}>

                    <Text style={styles.bto_Direita}>
                        <Icon
                            name="arrow-right"
                            size={35}
                            color="white"

                        />
                    </Text>
                    <Text style={styles.bto_esquerda}>
                         <Icon
                        name="arrow-left"
                        size={35}
                        color="white"

                    />
                    </Text>


                </TouchableOpacity>
            </View>
        );
    }
}


function Endereco(a) {
    return function ({ navigation }) {
        return (
            <View style={styles.body}>
                <View style={styles.teste}>
                    <TextInput
                        style={styles.input}
                        placeholder="N°-CEP"

                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Logradouro"

                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Numero"

                    />
                </View>
                <TouchableOpacity style={styles.botao} onPress={() => navigation.navigate(a)}>

                    <Text style={styles.bto_Direita}>
                        <Icon
                            name="arrow-right"
                            size={35}
                            color="white"

                        />
                    </Text>
                    <Text style={styles.bto_esquerda}>
                         <Icon
                        name="arrow-left"
                        size={35}
                        color="white"

                    />
                    </Text>


                </TouchableOpacity>
            </View>
        );
    }
}



const Tab = createBottomTabNavigator();


const styles = StyleSheet.create({
    header: {
        height: 250,
        backgroundColor: "#C7FFCC",


    },
    containerinfromacoes: {
        flex: 1,
        alignItems: "center",

    },
    textoInforma: {
        marginTop: 180,
        fontSize: 40,
        color: '#fff',
    },
    caixaIforma: {
        height: 350,
        width: 350,
        backgroundColor: '#FFF',
        borderRadius: 15,
        alignItems: 'center'
    },

    pedirInfo: {
        marginTop: 45,
        fontSize: 50,
    },
    bto_Direita: {
        display: 'flex',
        left: 105,
        top: 20,
        


    },
    botaoEsquerdo: {
        right: 105,
        bottom: 10
    },
    noob: {
        backgroundColor: '#C7FFCC',

    },
    body: {

        backgroundColor: '#FF3E3E40',
        width: 380,
        height: 500,
        alignItems: 'center',
        alignSelf: 'center',
        justifyContent: 'center',
        borderRadius: 15
    }


})
